import React, { useState } from "react";
import {
  TextField,
  Button,
  Container,
  Typography,
  Box,
  IconButton,
  InputAdornment,
  Divider,
  FormControl,
  InputLabel,
} from "@mui/material";
import { Visibility, VisibilityOff } from "@mui/icons-material";
import Logo from "../../assets/logo.png";
import { LoginTitle } from "./style";

const LoginForm = () => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [showPassword, setShowPassword] = useState(false); // State to toggle password visibility
  const [error, setError] = useState("");

  const handleClickShowPassword = () => {
    setShowPassword((prevState) => !prevState);
  };

  return (
    <Container>
      <Box
        sx={{
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
        }}
      >
        <img src={Logo} />
        <LoginTitle>Login</LoginTitle>
        <Divider />
        <form>
          <InputLabel>Name</InputLabel>
          <FormControl variant="standard" className="inputfield">
            <TextField fullWidth onChange={(e) => setEmail(e.target.value)} />
          </FormControl>
          <FormControl variant="standard" className="inputfield">
            <label>Password</label>
            <TextField
              type={showPassword ? "text" : "password"} // Toggle password visibility
              fullWidth
              onChange={(e) => setPassword(e.target.value)}
              sx={{
                backgroundColor: "#f4f4f4", // Light gray background color
                "& .MuiOutlinedInput-root": {
                  backgroundColor: "#f4f4f4", // Ensure the input area has the same bg color
                },
              }}
              InputProps={{
                endAdornment: (
                  <InputAdornment position="end">
                    <IconButton onClick={handleClickShowPassword} edge="end">
                      {showPassword ? <VisibilityOff /> : <Visibility />}
                    </IconButton>
                  </InputAdornment>
                ),
              }}
            />
          </FormControl>
          <Button type="submit" variant="contained" fullWidth>
            Login
          </Button>
        </form>
      </Box>
    </Container>
  );
};

export default LoginForm;
